package fr.eni.gameoflifev2.launcher;

public class PairInt{
	
	private int x;
	private int y;
	
	public PairInt(int x , int y) {
		// TODO Auto-generated constructor stub
		this.x = x;
		this.y = y;
	}
	
	public int getX() {
		return x;
	}
	
	public int getY() {
		return y;
	}

}
